// SPDX-License-Identifier: MIT
pragma solidity >=0.8.16 ;
contract comTest{
    using StringUtil for *;
    // function test() public {
    //     StringUtil.compare("cc","ad");
        
    // }
    function test() public returns (bool){
        return StringUtil.hashCompareWithLengthCheckInternal("cc","cd");
        
    }
}
library StringUtil{
    enum CompareResult {Equal, Less,Greater,Invalid}    //枚举

    function hashCompareWithLengthCheckInternal(string memory a, string memory b) public returns (bool) {
        if (bytes(a).length != bytes(b).length) {
            return false;
        } else {
            return keccak256(abi.encodePacked(a)) == keccak256(abi.encodePacked(b));
        }
    }
  
    //在solidity中，字符串是一组存储在数组中的字符，以字节为单位存储数据。
    //在字符串类型中没有长度方法。

    function compare(string memory str1, string memory str2) public returns(CompareResult){
        return CompareString(str1, str2);
        // //获取输入字符串的字节长度
        // uint  str1_length = bytes(str1).length;
        // uint  str2_length = bytes(str2).length;  

        // //true则str1短
        // bool boo = str1_length <= str2_length;
        // //得到较短字符字节长度
        // uint  slength = boo ? str1_length:str2_length;

        // if(str1_length==0 || str2_length==0){
        //     return CompareResult.Invalid;
        // }

        // else if(keccak256(bytes(str1))==keccak256(bytes(str2))){
        //     return CompareResult.Equal;

        // }

        // else if(boo){   //str1短
        //     if(str1==str2(0,str1_length)){
        //         return CompareResult.Less;

        //     }

        //     else{

        //         for (uint i = 0; i < slength; i++) {
        //             if (bytes(str1)[i]>bytes(str2)[i]) {

                        
        //             } 
                    
        //         }
        //     }
        // }

        // else{   //str2短
        //     if(str1==str2(0,str1_length)){
        //         return CompareResult.Less;

        //     }

        //     else{

        //         for (uint i = 0; i < slength; i++) {
        //             if (bytes(str1)[i]>bytes(str2)[i]) {

                        
        //             } 
                    
        //         }
        //     }
        // }

    
    }

    function CompareString(string memory t1,string memory t2) private pure returns(CompareResult res){
        bytes memory tb1 = bytes(t1);
        bytes memory tb2 = bytes(t2);
        uint  s_small = tb1.length <= tb2.length ? tb1.length:tb2.length;
        uint num = 0;
        if(tb1.length == tb2.length){
            for (uint256 i = 0; i < s_small; i++) {
                if(tb1[i]==tb2[i]){
                    num++;
                }
                if(num==s_small){
                    return CompareResult.Equal;
                }
            
            }

        }

        else{
            for (uint256 j = 0; j < s_small; j++) {
                if(tb1[j]==tb2[j]){
                    continue;
                }
                if(tb1[j]>tb2[j]){
                    return CompareResult.Greater;
                }
                else{
                    return CompareResult.Less;
                }
                
                
            }
        }
        

    }


}

